import React from 'react';

// Liste de vos projets
const projectList = [
  {
    title: "Jeu Morpion IA Imbattable",
    description: "Une IA qui ne perd jamais au morpion, utilisant un algorithme basé sur le Minimax.",
    link: "https://github.com/votre_compte/Jeu_Morpion_IA_Imbattable",
  },
  {
    title: "Jeu d'échecs IA Alpha-Beta",
    description: "Un moteur d'échecs puissant utilisant l'élagage Alpha-Beta.",
    link: "https://github.com/votre_compte/Jeu_echecs_IA_alpha_beta",
  },
  {
    title: "Classification Pokémon avec CNN",
    description: "Classifie les Pokémons avec un réseau de neurones convolutifs.",
    link: "https://github.com/votre_compte/Classification_Pokemons_CNN_python",
  },
  // Ajoutez vos autres projets ici
];

function Projects() {
  return (
    <section id="projects">
      <h2>Mes projets</h2>
      <div className="project-grid">
        {projectList.map((project, index) => (
          <div className="project-card" key={index}>
            <h3>{project.title}</h3>
            <p>{project.description}</p>
            <a href={project.link} target="_blank" rel="noopener noreferrer">Voir sur GitHub</a>
          </div>
        ))}
      </div>
    </section>
  );
}

export default Projects;
